import { Link } from 'react-router-dom';

function Home() {
  return (
    <div style={styles.container}>
      <h1 style={styles.title}>견적서 생성기</h1>
      <ul style={styles.list}>
        <li><Link to="/customs" style={styles.link}>1. 통관 견적서</Link></li>
        <li><Link to="/consulting" style={styles.link}>2. 컨설팅 견적서</Link></li>
        <li><Link to="/fta" style={styles.link}>3. FTA 견적서</Link></li>
        <li><Link to="/form" style={styles.link}>4. 과세자료 제출 컨설팅 견적서</Link></li>
      </ul>
    </div>
  );
}

const styles = {
  container: {
    maxWidth: '700px',
    margin: '100px auto',
    padding: '40px',
    border: '1px solid #e0e0e0',
    fontFamily: 'Arial, sans-serif',
    color: '#333',
    backgroundColor: '#fff',
    boxShadow: '0 0 10px rgba(0,0,0,0.05)',
  },
  title: {
    textAlign: 'center',
    marginBottom: '40px',
    fontSize: '28px',
    fontWeight: 'bold',
    letterSpacing: '1px',
  },
  list: {
    listStyle: 'none',
    padding: 0,
    lineHeight: '2.5',
    fontSize: '18px',
  },
  link: {
    textDecoration: 'none',
    color: '#000',
    borderBottom: '1px solid #ccc',
    display: 'block',
    paddingBottom: '8px',
    marginBottom: '12px',
    transition: 'all 0.3s',
  },
};

export default Home;
